import React from "react";
import { connect } from "react-redux";

function Fret(props) {
  //  try in-component styling

  // only change is addition of indian notation option

  const fretStyle = {
    color: "blue",
    width: 50,
    height: 25,
    padding: 1,
  };

  return (
    <div className="fret" style={fretStyle}>
      <p>this is a fret</p>
    </div>
  );
}

function mapStateToProps(state) {
  return {
    sharps: state.sharps,
    // etc
  };
}

export default connect(mapStateToProps)(Fret);
